import { StyleSheet } from 'react-native';

const style = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        aspectRatio: '24361125/',
        height: '1080px',
    },


    title: {
        color: '#C8DCFF'
    },
});

export { style }
